import React from "react";
import Navbar from "react-bootstrap/Navbar";

const NavbarBrand = (props) => {
    return (
        <Navbar.Brand className="navbar-brand" href="/" hidden={props.display}>
            <img
                src={props.src}
                alt={props.alt}
            />
        </Navbar.Brand>
    );
};

export default NavbarBrand;
